import React from 'react';
import './App.css';
import ExpenseEntryItem from './components/ExpenseEntryItem';
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component {
  constructor() {
    this.state = [
      { item1: { id:1,name:"Mango",price:34,date:"2022-12-12",category:"Food" }},
      { item2: {id:2,name:"Mango",price:34,date:"2022-12-12",category:"Food"}}
    ]
  }
  render() {
    return(
      <div>
        {this.state.map(item => (
        <ExpenseEntryItem item={item} />
      ))}
      </div>
    )
  }
}

export default App;
